[Form]
public class HMPhysicianAdvanceLookup extends FormRun
{
    boolean                     canSelect;
    HMAdvanceStaffLookupParm    parmEnum;
    HMOrderType                 orderType;
    containerClass conClass_Obj;
}

    public void closeSelect(str _selectString = "")
    {
        if(canSelect)
        {
            switch(parmEnum)
            {
                case HMAdvanceStaffLookupParm::Physician:
                    if(element.args().parm() == 'Consultation')
                    {
                        element.args().caller().storeConsultingPhysician(HMClinicStaff.RecId);
                    }
                    else if(element.args().parm() == 'FamilyDoctor')
                    {
                        element.args().caller().storeFamilyDoctor(HMClinicStaff.RecId);
                    }
                    else if(element.args().parm() == 'SpecialDoctor')
                    {
                        element.args().caller().storeConsultPhysician(HMClinicStaff.RecId);
                    }
                    else
                    {
                        element.args().caller().storePhysician(HMClinicStaff.RecId);
                    }
                    super(_selectString);
                    break;
                case HMAdvanceStaffLookupParm::Nurse:
                    element.args().caller().storeNurse(HMClinicStaff.RecId);
                    super(_selectString);
                    break;
                case HMAdvanceStaffLookupParm::NursePhysician:
                    super(_selectString);
                    break;
                case HMAdvanceStaffLookupParm::MultiNursePhysician:
                    element.args().caller().storePhysician(HMClinicStaff.RecId);
                    break;
                case HMAdvanceStaffLookupParm::PhysicianPractitionerNurse:
                    element.args().caller().storePhysicianPractitionerNurse(HMClinicStaff.RecId);
                    super(_selectString);
                    break;
                case HMAdvanceStaffLookupParm::Driver:
					if (isConfigurationkeyEnabled(configurationKeyNum(MazikCare)))
                    {
                        element.args().caller().storePhysicianPractitionerNurse(HMClinicStaff.RecId);
					}
					if (isConfigurationkeyEnabled(configurationKeyNum(MaterialManagement)))
                    {
                        element.args().caller().storeDriver(HMClinicStaff.RecId);
					}
                    super(_selectString);
                    break;
                case HMAdvanceStaffLookupParm::All:
                    element.args().caller().storeStaffMember(HMClinicStaff.RecId);
                    super(_selectString);
                    break;
            }
        }
    }

public void init()
{
    HMOrderType  HMOrderType;
    parmEnum = element.args().parmEnum();
    orderType = str2enum(HMOrderType,element.args().parm());
    conClass_Obj = element.args().parmObject();
    super();

    canSelect = false;
    element.selectMode(DirPerson_Name);
}

