public void run()
{
    boolean                         filterLookup;
    FormStringControl               callingControl;

    callingControl = SysTableLookup::getCallerStringControl(element.args());
    filterLookup = SysTableLookup::FilterLookupPreRun(callingControl,DirPerson_Name,DirPerson_DS);

    if (parmEnum == HMAdvanceStaffLookupParm::Nurse || parmEnum == HMAdvanceStaffLookupParm::Physician || parmEnum == HMAdvanceStaffLookupParm::ReferenceGroupPhysician || parmEnum == HMAdvanceStaffLookupParm::Driver)
    {
        HcmTitle_Type.visible(false);
    }
    else if (parmEnum == HMAdvanceStaffLookupParm::MultiNursePhysician || parmEnum == HMAdvanceStaffLookupParm::NursePhysician || parmEnum == HMAdvanceStaffLookupParm::PhysicianPractitionerNurse || parmEnum == HMAdvanceStaffLookupParm::ReferenceGroupPhysicianNursePracNurse || parmEnum == HMAdvanceStaffLookupParm::All)
    {
        HcmTitle_Type.visible(true);
    }

    super();

    SysTableLookup::FilterLookupPostRun(filterLookup,callingControl.text(), DirPerson_Name, DirPerson_DS);
}

    public void selectRecord()
    {
        canSelect = true;

        if(parmEnum == HMAdvanceStaffLookupParm::ReferenceGroupPhysician)
        {
			if(element.args().parm() == 'SpecialDoctor')
            {
                element.args().caller().storeConsultPhysician(HMClinicStaff.RecId);
            }
            else
            {
				element.args().caller().storePhysician(HMClinicStaff.RecId);
            }
        }
        else if(parmEnum == HMAdvanceStaffLookupParm::ReferenceGroupPhysicianNursePracNurse)
        {
            element.args().caller().storePhysicianNursePracNurse(HMClinicStaff.RecId);
        }
        else
        {
            element.closeSelect(DirPerson.Name);
        }

    }

public int active()
{
    int ret;

    ret = super();
    if(ret)
    {
        element.loadImage();
    }
    return ret;
}

public void buildQueryRangeHM(HMCaseType  type)
{
    HMResourceSchedulingPlanningObject  HMResourceSchedulingPlanningObjectLocal;
    HMStaffNursingUnit                  HMStaffNursingUnitLocal;

    while    select * from HMStaffNursingUnitLocal where   HMStaffNursingUnitLocal.HMClinicStaff ==  HMClinicStaff::findByWorker(HcmWorkerLookup::currentWorker()).RecId
    {
        while select HMClinicStaff from  HMResourceSchedulingPlanningObjectLocal  group by HMResourceSchedulingPlanningObjectLocal.HMClinicStaff

               where HMResourceSchedulingPlanningObjectLocal.CaseType == type

               && HMResourceSchedulingPlanningObjectLocal.HMClinicStaff != 0
               && HMResourceSchedulingPlanningObjectLocal.HMOrganizationalUnit == HMStaffNursingUnitLocal.HMOrganizationalUnit

        {
            this.queryBuildDataSource().addRange(fieldNum(HMClinicStaff,RecId)).value(SysQuery::value(HMResourceSchedulingPlanningObjectLocal.HMClinicStaff));
        }
    }
}

public void init()
{        
   container   con;
   HMCaseType  type;
   super();

    if (orderType == HMOrderType::Appointment)
    {
        if (conClass_Obj)
        {
           con = conClass_Obj.value();
           type =  conPeek(con,1);

           this.buildQueryRangeHM(type); 
        }

    }

}

public void init()
{
    super();

     switch(parmEnum)
    {
        case HMAdvanceStaffLookupParm::Physician:
            this.query().dataSourceTable(tablenum(HMClinicStaffRole)).addRange( fieldNum(HMClinicStaffRole,Role)).value(SysQuery::value(HMStaffMemberType::Physician));
            break;
        case HMAdvanceStaffLookupParm::ReferenceGroupPhysician:
            this.query().dataSourceTable(tablenum(HMClinicStaffRole)).addRange( fieldNum(HMClinicStaffRole,Role)).value(SysQuery::value(HMStaffMemberType::Physician));
            break;
        case HMAdvanceStaffLookupParm::Nurse:
            this.query().dataSourceTable(tablenum(HMClinicStaffRole)).addRange( fieldNum(HMClinicStaffRole,Role)).value(SysQuery::value(HMStaffMemberType::Nurse));
            break;
        case HMAdvanceStaffLookupParm::NursePhysician:
            this.query().dataSourceTable(tablenum(HMClinicStaffRole)).addRange( fieldNum(HMClinicStaffRole,Role)).value(SysQuery::value(HMStaffMemberType::Physician));
            this.query().dataSourceTable(tablenum(HMClinicStaffRole)).addRange( fieldNum(HMClinicStaffRole,Role)).value(SysQuery::value(HMStaffMemberType::Nurse));
            break;
        case HMAdvanceStaffLookupParm::MultiNursePhysician:
            this.query().dataSourceTable(tablenum(HMClinicStaffRole)).addRange( fieldNum(HMClinicStaffRole,Role)).value(SysQuery::value(HMStaffMemberType::Physician));
            this.query().dataSourceTable(tablenum(HMClinicStaffRole)).addRange( fieldNum(HMClinicStaffRole,Role)).value(SysQuery::value(HMStaffMemberType::Nurse));
            this.query().dataSourceTable(tablenum(HMClinicStaffRole)).addRange( fieldNum(HMClinicStaffRole,Role)).value(SysQuery::value(HMStaffMemberType::NursePractitioner));
            break;
        case HMAdvanceStaffLookupParm::ReferenceGroupPhysicianNursePracNurse:
            this.query().dataSourceTable(tablenum(HMClinicStaffRole)).addRange( fieldNum(HMClinicStaffRole,Role)).value(SysQuery::value(HMStaffMemberType::Physician));
            this.query().dataSourceTable(tablenum(HMClinicStaffRole)).addRange( fieldNum(HMClinicStaffRole,Role)).value(SysQuery::value(HMStaffMemberType::Nurse));
            this.query().dataSourceTable(tablenum(HMClinicStaffRole)).addRange( fieldNum(HMClinicStaffRole,Role)).value(SysQuery::value(HMStaffMemberType::NursePractitioner));
            break;
        case HMAdvanceStaffLookupParm::PhysicianPractitionerNurse:
            this.query().dataSourceTable(tablenum(HMClinicStaffRole)).addRange( fieldNum(HMClinicStaffRole,Role)).value(SysQuery::value(HMStaffMemberType::Physician));
            this.query().dataSourceTable(tablenum(HMClinicStaffRole)).addRange( fieldNum(HMClinicStaffRole,Role)).value(SysQuery::value(HMStaffMemberType::NursePractitioner));
            break;
        case HMAdvanceStaffLookupParm::Driver:
            //this.query().dataSourceTable(tablenum(HMClinicStaffRole)).addRange( fieldNum(HMClinicStaffRole,Role)).value(SysQuery::value(HMStaffMemberType::Driver));
            this.query().dataSourceTable(tablenum(HMClinicStaffRole)).addRange( fieldNum(HMClinicStaffRole,Role)).value(SysQuery::value(HMStaffMemberType::Administration));
            this.query().dataSourceTable(tablenum(HMClinicStaffRole)).addRange( fieldNum(HMClinicStaffRole,Role)).value(SysQuery::value(HMStaffMemberType::Staff));
            break;
    }
}
